export default (function(a,b,c,d){return {data:{i3C9gGb5zL:{data:{id:1359,attributes:{imdbId:"tt0091164",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZWZmZjUyMDEtYTg0MC00MDI3LTgzMTAtNjU4ZTUyNTM4NTNkXkEyXkFqcGdeQXVyMTQ3Njg3MQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.4\u002F10"},{Source:"Rotten Tomatoes",Value:"50%"}],item_lang:{data:{id:2022,attributes:{title:d,plot:"Dr. Lauren Slaughter, a brilliant research fellow at the Arab-Anglo Institute in London is utterly frustrated by her career. To supplement her income, she starts moonlighting at the Jasmine Escort Service, where she has more control over men and money than she does at the office. On one of her dates, Lauren meets the politician Lord Sam Bulbeck who is trying to mediate a peace accord between the Arabs and Israelis. Bulbeck falls in love with his escort, and unwittingly, Lauren becomes a pawn in some very dirty politics.",slug:"half-moon-street"}}},books:{data:[{id:7332,attributes:{title:d,description:"Two short novels offer a menacing, sinister study of double lives and their deadly implications",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pP5X7FF2cK0C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"1986-01-01",publisher:"Pocket Books",subtitle:a}},{id:7333,attributes:{title:"Half Moon Street [sound Recording]",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1000-01-01",publisher:a,subtitle:a}},{id:7334,attributes:{title:"The Collected Stories",description:"This anthology includes \"Half Moon Street\", \"Dr Demarr\", a selection from \"World's End\" and \"Sinning With Annie\" as well as four previously uncollected pieces. From Corsica to Boston, India and provincial Holland, these stories reflect Theroux's diversity of writing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=UXggAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1997-01-01",publisher:a,subtitle:a}},{id:7335,attributes:{title:"The Great Railway Bazaar",description:"In this unique and hugely entertaining railway odyssey, Theroux vividly recounts his travels--and the people, places, and landscapes he encountered--on the Orient Express, the Khyber Mail, and the Trans-Siberian Express, through such countries as Turkey, Iran, India, Southeast Asia, Japan, and the Soviet Union.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Jdi252WQK_UC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1976-01-01",publisher:a,subtitle:"By Train Through Asia"}},{id:7336,attributes:{title:"Picture Palace",description:"World-famous photographer Maude Coffin Pratt has pointed her lens at the beautiful, obscure, and obscene, and at the private places and public parts of the famous, from Gertrude Stein to Graham Greene. When the seventy-year-old Maude rummages through her archives in preparation for a triumphant retrospective, the resurrected images unleash a flood of suppressed memories--of her extraordinary life, her celebrated subjects, and the dark, painful secret at the core of her existence.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9_qEV17-cfcC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1979-01-01",publisher:"Ballantine Books",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940983117}}("","Paul Theroux",null,"Half Moon Street"))